INSERT [dbo].[product] ([id], [title], [description], [picture], [ingredients]) VALUES (19900, N'Deutschland Burger', N'Der Transfercoup ist perfekt. Endlich zurück im McDonald’s Kader: Der Deutschland Burger! Saftiges Beef aus Deutschland, knuspriger Bacon, zartschmelzender Cheese und die Sauce in Kräuterbutter-Style treffen den Geschmack aller Burger-Fans. Unser Publikumsliebling weiß aber auch optisch zu überzeugen. Schließlich macht sein Schwarz-Rot-Gold bestreutes Bun auf den ersten Blick klar, wer der Kapitän beim Taste ist.', N'https://www.mcdonalds.com/is/image/content/dam/de/nutrition/items/icons/desktop/6766_thumb.jpg?$Category_Desktop$', N'Bacon Streifen: Zutaten: Schweinebauchspeck (92%), Salz, Konservierungsstoff: (E250), Säureregulator: (E326), Stabilisator: (E450), Antioxidationsmittel: (E301), Raucharomen, Glucosesirup, Aromen.  Schmelzkäsezubereitung Cheddar: Zutaten: KÄSE (49%), Wasser, Cheddar KÄSE (11%), BUTTER, MAGERMILCHPULVER, Schmelzsalze (E331), natürliches KÄSEaroma, MILCHEIWEISS, Speisesalz, Farbstoffe (Beta-Carotin, Paprikaextrakt), Säureregulator (E330), Trennmittel: Sonnenblumenlecithine. , KÄSE (49%), Wasser, Cheddar KÄSE (11%), BUTTER, MAGERMILCHPULVER, Schmelzsalze (E331), natürliches KÄSEaroma, MILCHEIWEISS, Speisesalz, Farbstoffe (Beta-Carotin, Paprikaextrakt), Säureregulator (E330), Trennmittel: Sonnenblumenlecithine.  Zwiebeln, rot: Zutaten: 100% rote Zwiebeln.  Bun Schwarz Rot Gold: Zutaten: WEIZENMEHL, Wasser, Glukose-Fruktose-Sirup, Hefe, Rapsöl, Maisgrieß, Speisesalz, Emulgator: (E471, E472e), Erbsenprotein, Pfeffer, Zucker, färbender Paprikaextrakt, Mehlbehandlungsmittel: (E300).  Sauce Kräuterbutter Style: Zutaten: Wasser, 19% Butterfett, Rapsöl, 5% Petersilie, Zucker, Branntweinessig, modifizierte Maisstärke, Knoblauch, Schalotten, Zitronensaft aus Konzentrat, Eigelb, Gewürze, Salz, natürliches Aroma (mit Milch), Verdickungsmittel (E 415), Konservierungsstoff (E 202).  Sauce Steak Bull: Zutaten: Tomatenmark, Zucker, Branntweinessig, Gemüsepaprika, Zwiebeln, Karamellzuckersirup, Salz, Gewürze (mit SENFSAAT, SELLERIE), modifizierte Maisstärke, Verdickungsmittel (E 415), Konservierungsstoff (E 202).  Salat Lollo Bionda: Zutaten: Lollo Bionda, unregelmäßiger Schnitt.  Tomatenscheibe: Zutaten: 100% Tomate. , 100% Tomate.  Beef Patty 3:1 Flowershape: Zutaten: 100% Rindfleisch.')
INSERT [dbo].[product] ([id], [title], [description], [picture], [ingredients]) VALUES (19901, N'Netzkartoffeln', N'Unsere Netzkartoffeln sind immer gut für eine knusprige Einzelaktion. Aber auch im Menü-Team will sie jeder gerne dabeihaben. Denn gerade im Doppelpass mit einem unserer köstlichen Burger sorgen sie für eine unschlagbar köstliche Kombination.', N'https://www.mcdonalds.com/is/image/content/dam/de/nutrition/items/icons/desktop/3082_thumb.jpg?$Category_Desktop$', N'Seasoned Criss-Cuts: Zutaten: Kartoffeln, pflanzliche Öle (Sonnenblume, Raps, in veränderlichen Gewichtsanteilen), modifizierte Stärke, Maismehl, Reismehl, Salz, Stärke, Gewürze, Knoblauchpulver, Zwiebelpulver, Backtriebmittel (E450(i), E500(ii)), Hefeextrakt, Gewürzextrakte, Verdickungsmittel (E415), Dextrose.')
INSERT [dbo].[product] ([id], [title], [description], [picture], [ingredients]) VALUES (19903, N'5 Crispy Shrimps (panierte Garnelen)', N'Du brauchst im Spiel gegen deinen Hunger eine starke Einwechslung? Hol dir doch gleich 5! Auf die Kombi aus köstlichen Crispy Shrimps und himmlischem Cocktail Dip ist einfach Verlass.', N'https://www.mcdonalds.com/is/image/content/dam/de/nutrition/items/icons/desktop/3360_thumb.jpg?$Category_Desktop$', N'Shrimps paniert: Zutaten: GARNELEN 53%, WEIZENMEHL, modifizierte Tapiokastärke, Trinkwasser, teilweise gehärtetes Palmöl, Zucker, Speisesalz, Backtriebmittel E 500 und E 450, Hefe, Gewürze. , GARNELEN, Panade (WEIZENMEHL, Wasser, modifizierte Tapiokastärke, Reismehl, modifizierte Maisstärke, Maismehl, Salz, Hefe, Sonnenblumenöl, Zwiebelpulver, Knoblauchpulver, Dextrose, Stabilisator: Guarkernmehl , schwarzer Pfeffer).')
INSERT [dbo].[product] ([id], [title], [description], [picture], [ingredients]) VALUES (19906, N'8 Crispy Shrimps (panierte Garnelen)', N'Wenn du gar nicht genug von unseren leckeren Crispy Shrimps bekommst, gönn dir direkt die größere 8er Box. Gemeinsam mit dem leckeren Cocktail Dip geben sie ein unschlagbar gutes Team ab.', N'https://www.mcdonalds.com/is/image/content/dam/de/nutrition/items/icons/desktop/3361_thumb.jpg?$Category_Desktop$', N'Shrimps paniert: Zutaten: GARNELEN 53%, WEIZENMEHL, modifizierte Tapiokastärke, Trinkwasser, teilweise gehärtetes Palmöl, Zucker, Speisesalz, Backtriebmittel E 500 und E 450, Hefe, Gewürze. , GARNELEN, Panade (WEIZENMEHL, Wasser, modifizierte Tapiokastärke, Reismehl, modifizierte Maisstärke, Maismehl, Salz, Hefe, Sonnenblumenöl, Zwiebelpulver, Knoblauchpulver, Dextrose, Stabilisator: Guarkernmehl , schwarzer Pfeffer).')
INSERT [dbo].[product] ([id], [title], [description], [picture], [ingredients]) VALUES (19910, N'Chicken + Shrimps Box (panierte Garnelen)', N'Diese Aufstellung haben sich unsere schlauesten Taktikfüchse für dich überlegt. Wer sonst würde auf die großartige Idee kommen, 12 knusprige Chicken McNuggets zusammen mit 6 herrlichen Crispy Shrimps und 3 legendären Dips in eine Box zu packen? Völlig klar, dass dieses Team zu den großen Geschmacks-Favoriten zählt.', N'https://www.mcdonalds.com/is/image/content/dam/de/nutrition/items/icons/desktop/3212_thumb.jpg?$Category_Desktop$', N'Shrimps paniert: Zutaten: GARNELEN 53%, WEIZENMEHL, modifizierte Tapiokastärke, Trinkwasser, teilweise gehärtetes Palmöl, Zucker, Speisesalz, Backtriebmittel E 500 und E 450, Hefe, Gewürze. , GARNELEN, Panade (WEIZENMEHL, Wasser, modifizierte Tapiokastärke, Reismehl, modifizierte Maisstärke, Maismehl, Salz, Hefe, Sonnenblumenöl, Zwiebelpulver, Knoblauchpulver, Dextrose, Stabilisator: Guarkernmehl , schwarzer Pfeffer).  Chicken McNuggets: Zutaten: Hähnchenbrustfleisch (46%), Wasser, Mehl (WEIZEN, Mais), pflanzliche Öle (Sonnenblume, Raps), Stärke (enthält WEIZEN), WEIZENGRIEß, Salz, Paniermehl (WEIZENMEHL, Salz), natürliche Aromen (enthält WEIZEN), WEIZENGLUTEN, Zucker, Backtriebmittel: (Natriumcarbonate), Gewürze (enthält SELLERIE), Gewürzextrakte (enthält SELLERIE). Hähnchenbrustfleisch (46%), Wasser, pflanzliche Öle: (Sonnenblume, Raps), Maismehl, WEIZENMEHL, Stärke (enthält WEIZEN), WEIZENGRIEß, Salz, natürliches Aroma (enthält WEIZEN), WEIZENGLUTEN, Gewürze (enthält SELLERIE), Gewürzextrakte (enthält SELLERIE), Zucker, Backtriebmittel: (Natriumcarbonate).')
