INSERT [dbo].[product] ([id], [title], [description], [picture], [ingredients]) VALUES (20005, N'McWrap® Chicken Sweet-Chili', N'Der McWrap® Chicken Sweet-Chili nimmt dich mit auf eine Genussreise: Leckeres Weizentortilla mit paniertem Hähnchenfleisch, roten Zwiebeln und knackigem Eisbergsalat. Was dieses Geschmackserlebnis abrundet: Die Kombination aus milder Sandwich-Sauce mit unserer feurigen Chili-Sauce.', N'https://www.mcdonalds.com/is/image/content/dam/de/nutrition/items/icons/desktop/6297_thumb.jpg?$Category_Desktop$', N'Chicken Patty Classic: Zutaten: Hähnchenfleisch (62%), Wasser, WEIZENMEHL, pflanzliche Öle (Sonnenblume, Raps), HARTWEIZENGRIEß, Maismehl, modifizierte Stärke (enthält WEIZEN), Salz, WEIZENGLUTEN, Gewürze (enthält SELLERIE), Dextrose, Stärke (enthält WEIZEN), Verdickungsmittel (Methylcellulose), Backtriebmittel: (Diphosphate, Natriumcarbonate), Hefe.  Hähnchenfleisch (62%), Wasser, WEIZENMEHL, pflanzliche Öle (Sonnenblume, Raps), HARTWEIZENGRIEß, modifizierte Stärke (enthält WEIZEN), Maismehl, Salz, WEIZENGLUTEN, Gewürze (enthält SELLERIE), Dextrose, Stärke (enthält WEIZEN), Backtriebmittel (Diphosphate, Natriumcarbonate), Verdickungsmittel (Methylcellulose), Hefe. , Hühnerfleisch (62%), Wasser, WEIZENMEHL, pflanzliche Öle (Sonnenblume, Raps), HARTWEIZENGRIEß, Maismehl, modifizierte Stärke (enthält WEIZEN), Salz, Stärke (enthält WEIZEN), WEIZENGLUTEN, Gewürze (enthält SELLERIE), Backtriebmittel (Natriumcarbonate, Dinatriumdiphosphat), Dextrose, Hefe, Verdickungsmittel (Methylcellulose).  Zwiebeln, rot: Zutaten: 100% rote Zwiebeln.  Bun Tortilla Grillstreifen: Zutaten: Angereichertes WEIZENMEHL (WEIZENMEHL, Calcium, Eisen, Niacin, Thiamin), Wasser, pflanzliche Öle (Palmöl, Rapsöl), Zucker, Backtriebmittel (Natriumbicarbonat, Dinatriumdiphosphat, Äpfelsäure), Speisesalz.  Sauce Sweet Chili: Zutaten: Zucker, Glukosesirup, Tomatenmark, Gemüsepaprika, Branntweinessig, Chilis (3,0%), Salz, Verdickungsmittel: (E415), Gewürze, Zitronensaft aus Konzen