INSERT [dbo].[product] ([id], [title], [description], [picture], [ingredients]) VALUES (20020, N'McWrap Chicken Caesar', N'Zu diesem Wrap kann man „Sie“ sagen. Denn die legendäre Caesar Sauce macht den McWrap® Chicken Caesar zu einem hochachtungsvollen Geschmackserlebnis. Mit paniertem Hähnchenfleisch, knusprigen Croûtons, würzigem italienischem Hartkäse sowie Eisbergsalat. Einfach herrlich!', N'https://www.mcdonalds.com/is/image/content/dam/de/nutrition/items/icons/desktop/6228_thumb.jpg?$Category_Desktop$', N'Chicken Patty Classic: Zutaten: Hähnchenfleisch (62%), Wasser, WEIZENMEHL, pflanzliche Öle (Sonnenblume, Raps), HARTWEIZENGRIESS, Maismehl, modifizierte Stärke (enthält WEIZEN), Salz, WEIZENGLUTEN, Gewürze (enthält SELLERIE), Dextrose, Stärke (enthält WEIZEN), Verdickungsmittel (Methylcellulose), Backtriebmittel: (Diphosphate, Natriumcarbonate), Hefe. Hähnchenfleisch (62%), Wasser, WEIZENMEHL, pflanzliche Öle (Sonnenblume, Raps), HARTWEIZENGRIESS, Maismehl, modifizierte Stärke (enthält WEIZEN), Salz, WEIZENGLUTEN, Gewürze (enthält SELLERIE), Dextrose, Stärke (enthält WEIZEN), Verdickungsmittel (Methylcellulose), Backtriebmittel: (Diphosphate, Natriumcarbonate), Hefe. Hühnerfleisch (62%), Wasser, WEIZENMEHL, pflanzliche Öle (Sonnenblume, Raps), HARTWEIZENGRIESS, Maismehl, modifizierte Stärke (enthält WEIZEN), Salz, Stärke (enthält WEIZEN), WEIZENGLUTEN, Gewürze (enthält SELLERIE), Backtriebmittel (Natriumcarbonate, Dinatriumdiphosphat), Dextrose, Hefe, Verdickungsmittel (Methylcellulose).  Bun Tortilla Grillstreifen: Zutaten: Angereichertes WEIZENMEHL (WEIZENMEHL, Calcium, Eisen, Niacin, Thiamin), Wasser, pflanzliche Öle (Palmöl, Rapsöl), Zucker, Backtriebmittel (Natriumbicarbonat, Dinatriumdiphosphat, Äpfelsäure), Speisesalz.  Sauce Caesar Style: Zutaten: Wasser, Rapsöl, Zucker, Branntweinessig, modifizierte Maisstärke, KÄSE, Limettensaft aus Konzentrat, PARMIGIANO REGGIANO, Gewürze, Salz, MILCHEIWEISS, MOLKENPULVER, BUTTER, Hefeextrakt, Säuerungsmittel: (E27