INSERT [dbo].[product] ([id], [title], [description], [picture], [ingredients]) VALUES (20566, N'Himbeer-Tasche', N'Unsere neueste heiße Tasche ist einfach top. Denn sie ist nicht nur himbeerig-fruchtig, sondern hat auch den leckeren Creamcheese-Flavour. Kein Wunder, dass sie doppelt gut schmeckt. Sag bloß, du hast sie noch nicht probiert?', N'https://www.mcdonalds.com/is/image/content/dam/de/nutrition/items/icons/desktop/4085_thumb.jpg?$Category_Desktop$', N'Pink pie with Raspberry and Cream Cheese filling: Zutaten: WEIZENMEHL, FRISCHKÄSECREMEFÜLLUNG 24% (körniger FRISCHKÄSE (40%), Zucker, Wasser, Verdickungsmittel: E1442, Palmöl, Verdickungsmittel: E460, E466; Konservierungstoff: E202, Säureregulator: E330, Farbstoffe: E170, E160), Wasser, Himbeeren 9%, pflanzliche Öle (Palm, Raps), Glukose-Fruktose-Sirup, Verdickungsmittel: E1422, E1412, E410; Zucker, Speisesalz, Farbstoff: E162, Dextrose, natürliches Aroma, Backtriebmittel: E500; Hefeextrakt; Emulgator E471; Säureregulator: E330.')
INSERT [dbo].[product] ([id], [title], [description], [picture], [ingredients]) VALUES (20603, N'Fruit Smoothie Mango-Ananas 0,3l', N'Schick deine Geschmacksnerven in den Wellness-Urlaub! Der Mango-Ananas-Smoothie ist so tropisch lecker und erfrischend, dass man gar nicht genug davon bekommen kann. Worauf wartest du noch? Jetzt eiskalt genießen!', N'https://www.mcdonalds.com/is/image/content/dam/de/nutrition/items/icons/desktop/7440_thumb.jpg?$Category_Desktop$', N'Eiswürfel: Zutaten: Trinkwasser. Mango Pineapple Smoothie: Zutaten: Wasser, Mangomark, Mangomarkkonzentrat, Ananassaftkonzentrat, Bananenmark, Birnensaftkonzentrat, Zitronensaftkonzentrat, Stabilisator (Xanthan E 415), natürliches Aroma.')
