INSERT [dbo].[product] ([id], [title], [description], [picture], [ingredients]) VALUES (20981, N'Signature Salsa Avocado', N'Du brauchst in der tristen Jahreszeit etwas Abwechslung? Dann gönn dir den neuen Signature Salsa Avocado mit leckerer Avocadocreme, würzigem Zwiebel-Salsa-Mix sowie zwei Lagen saftigem Beef. Überrasch deinen Gaumen und genieß den unvergleichbaren Signature-Geschmack!', N'https://www.mcdonalds.com/is/image/content/dam/de/nutrition/items/icons/desktop/6163_thumb.jpg?$Category_Desktop$', N'Bacon Streifen: Zutaten: Schweinebauchspeck (92%), Salz, Konservierungsstoff: (E250), Säureregulator: (E326), Stabilisator: (E450), Antioxidationsmittel: (E301), Raucharomen, Glucosesirup, Aromen.  Zwiebeln, rot: Zutaten: 100% rote Zwiebeln. Beef Patty 4:1: Zutaten: 100% Rindfleisch.  Sauce Tomaten-Zwiebel Mix: Zutaten: Tomaten 58 %, Zwiebeln 20 %, Trinkwasser, Rapsöl, Speisesalz, Olivenöl, Branntweinessig, Zucker, Stärke, Knoblauch, Gewürze, Kräuter, Verdickungsmittel: Xanthan, Antioxidationsmittel: Ascorbinsäure, Säureregulator: Natriumacetate, Konservierungsstoff: Kaliumsorbat.  Salat Lollo Bionda: Zutaten: Lollo Bionda, unregelmäßiger Schnitt.  Jalapeno Ringe: Zutaten: Jalapeño-Chili-Schoten, Wasser, Branntweinessig, Speisesalz, Festigungsmittel (Calciumchlorid), Gewürze. Käse: Zutaten: Zutaten: MILCH, Käsereikulturen, Speisesalz, mikrobielles Lab.  Sauce Guacamole: Zutaten: Hass Avocado, Zwiebeln, Jalapeno Chili, Serrano Chili, Knoblauch, Salz, Zucker, Zitronensaftkonzentrat, Verdickungsmittel: Xanthan, Antioxidationsmittel: (Ascorbinsäure, Citronensäure).  Bun Brioche Style: Zutaten: WEIZENMEHL, Wasser, Glucose-Fructose-Sirup, Hefe, WEIZENGLUTEN, Rapsöl, BUTTERÖL, MAGERMILCHPULVER, Speisesalz, Glucosesirup, MILCHPROTEIN, Kurkuma, Erbsenprotein, Reismehl, natürliches BUTTERAROMA (enthält MILCH), Emulgator (E472e), Mehlbehandlungsmittel (E300). , WEIZENMEHL, Wasser, Zucker, WEIZENEIWEISS, BUTTERÖL, Rapsöl, MAGERMILCHPULVER, Hefe, Salz, Glukosesirup, Erbsene