INSERT [dbo].[product] ([id], [title], [description], [picture], [ingredients]) VALUES (22903, N'Heiße Apfeltasche', N'Da ist jeder heiß drauf! Die Apfeltasche mit ihrer warmen Apfel-Zimt-Füllung im knusprigen Teigmantel schmeckt paradiesisch gut. So knusprig und fruchtig-fein, dass ihr niemand widerstehen kann. Einfach ein heißes Teil!', N'https://www.mcdonalds.com/is/image/content/dam/de/nutrition/items/icons/desktop/4060_thumb.jpg?$Category_Desktop$', N'Apfeltasche: Zutaten: Wasser, Weizenmehl, 22% Äpfel, pflanzliche Öle: (Palmöl, Rapsöl), Zucker, Verdickungsmittel: (E1422, E1412), Dextrose, Zimt gemahlen, Muskatnuss gemahlen, Extrakt aus Cassiazimt, Salz, Glukose-Fruktose-Sirup, Zitronensaftkonzentrat, Backtriebmittel: (E500 (ii)), Verdickungsmittel: (E410), Mehlbehandlungsmittel: (Protease, Hefeextrakt), Emulgator: (E471), Säureregulator: (E330).')
INSERT [dbo].[product] ([id], [title], [description], [picture], [ingredients]) VALUES (22981, N'McFrappé 0,3l', N'Dieser McFrappé ist erste Sahne! Der eiskalte Milchshake mit Kaffeegeschmack und mit Karamell-Sauce sowie Sahne garniert lässt keine Wünsche offen. Einfach köstlich, cremig, unwiderstehlich!', N'https://www.mcdonalds.com/is/image/content/dam/de/nutrition/items/icons/desktop/7467_thumb.jpg?$Category_Desktop$', N'Eiswürfel: Zutaten: Trinkwasser. Sirup mit Kaffeegeschmack: Zutaten: Wasser, Zucker, Glukosesirup, löslicher Kaffee 6%, Säuerungsmittel: Citronensäure, Emulgator: Mono- und Diglyceride von Speisefettsäuren.  Topping Karamell: Zutaten: Glukosesirup, gezuckerte KONDENSMILCH: (VOLLMILCH, Zucker), Glukose-Fruktose-Sirup, BUTTER, Verdickungsmittel: (Pektin), Salz, Stabilisator: (Natriumcitrat).  Sahne: Zutaten: SAHNE (20%), Zucker (5%), getrockneter Glukose-Sirup (3%), Treibgas: (Distickstoffmonoxide (E942)), Emulgator: (Mono- und Diglyceride von Speisefettsäuren (E471), Milchsäureester von Mono- und Diglyceriden von Speisefettsäuren (E472b)), Stabilisator: (Carrageen (E407)).  Shake Mix 2,5% Fett: Zutaten: VOLLMILCH, MAGERMILCH, Zucker, SÜSSMOLKENPULVER, Glukosesirup, Stabilisatoren (E412, E407, E410).')
