INSERT [dbo].[product] ([id], [title], [description], [picture], [ingredients]) VALUES (23221, N'Frucht-Quatsch', N'Dieses Frucht-Püree schmeckt und macht auch noch Spaß! Fruchtige Äpfel, Nektarinen und Erdbeeren sorgen für Energie - und das ohne Zuckerzusatz, ohne Zusatz von Aromen, ohne Farbstoffe oder Konservierungsstoffe.', N'https://www.mcdonalds.com/is/image/content/dam/de/nutrition/items/icons/desktop/4088_thumb.jpg?$Category_Desktop$', N'Fruchtquatsch: Zutaten: Äpfel 65%, Nektarinen 20%, Erdbeeren 15%.  Obst- und Gemüsedelikatessen GmbH Oberwagram 30 a-4331 Naarn.  Nach dem Öffnen gekühlt lagern und innerhalb von einem Tag verzehren.')
INSERT [dbo].[product] ([id], [title], [description], [picture], [ingredients]) VALUES (23303, N'Bio Apfeltüte 60g', N'Die köstlichen Apfelspalten sind der perfekte Snack für zwischendurch.', N'https://www.mcdonalds.com/is/image/content/dam/de/nutrition/items/icons/desktop/4092_thumb.jpg?$Category_Desktop$', N'Zutaten: Äpfel, Antioxidationsmittel: (Ascorbinsäure), Säureregulator: (Calciumcarbonat). Hersteller: Gebr. Bagusat GmbH & Co. KG, 82538 Geretsried, Deutschland. Hersteller: Hessing Fruit BV, Postfach 88, NL-1693 ZH Wervershoof, www.hessingfruit.eu. Bei +1° C bis +7° C mindestens haltbar bis: siehe Beutelaufdruck. Nach dem Öffnen des Beutels Produkt sofort verzehren! Unter Schutzatmosphäre verpackt.')
INSERT [dbo].[product] ([id], [title], [description], [picture], [ingredients]) VALUES (23386, N'McMuffin® Bacon & Egg', N'Der Tag kann beginnen!

