INSERT [dbo].[product] ([id], [title], [description], [picture], [ingredients]) VALUES (23470, N'McMuffin® Fresh Chicken', N'Genussvoller Start in den Tag!
  Köstlich, saftig und wahnsinnig lecker. Der McMuffin Fresh Chicken ist das perfekte Frühstücksprodukt für jeden, der schon am Morgen Lust auf etwas „Herzhaftes“ hat. Knusprig paniertes Hähnchenfleisch, würzige Schmelzkäsezubereitung, knackiger Salat und Tomaten werden mit einer milden Sauce abgerundet und sind einfach nur ein Genuss.', N'https://www.mcdonalds.com/is/image/content/dam/de/nutrition/items/icons/desktop/1531_thumb.jpg?$Category_Desktop$', N'Bun Muffin: Zutaten: WEIZENMEHL, Wasser, Maisgrieß, Hefe, Dextrose, Salz, WEIZENGLUTEN, Emulgatoren: (Mono- und Diglyceride von Speisefettsäuren (E471), Diacetylweinsäureester von Mono- und Diglyceriden von Speisefettsäuren (E472e)), Säuerungsmittel: (Citronensäure (E330)), WEIZENVOLLKORNMEHL, ROGGENVOLLKORNMEHL. Erzeugnis aus Butter- und Sonnenblumenöl. Zutaten: Sonnenblumenöl (75%), BUTTERÖL (21%), Emulgatoren: (E471), Lecithine (Sonnenblumen), MOLKENERZEUGNIS (MILCH), Antioxidationsmittel: (E304, E307), BUTTERAROMA.  Schmelzkäsezubereitung Cheddar: Zutaten: KÄSE (49%), Wasser, Cheddar KÄSE (11%), BUTTER, MAGERMILCHPULVER, Schmelzsalze (E331), natürliches KÄSEaroma, MILCHEIWEISS, Speisesalz, Farbstoffe (Beta-Carotin, Paprikaextrakt), Säureregulator (E330), Trennmittel: Sonnenblumenlecithine. KÄSE (49%), Wasser, Cheddar KÄSE (11%), BUTTER, MAGERMILCHPULVER, Schmelzsalze (E331), natürliches KÄSEaroma, MILCHEIWEISS, Speisesalz, Farbstoffe (Beta-Carotin, Paprikaextrakt), Säureregulator (E330), Trennmittel: Sonnenblumenlecithine.  Patty Chicken Value: Zutaten: Hähnchenfleisch (46%), WEIZENMEHL, Wasser, pflanzliche Öle (Sonnenblume, Raps), WEIZENGRIEß, Stärke, Salz, WEIZENGLUTEN, Gewürze, Hefeextrakt, modifizierte Stärke (enthält WEIZEN), Dextrose.  Hähnchenfleisch (46%), WEIZENMEHL, Wasser, pflanzliche Öle (Sonnenblume, Raps), Stärke, WEIZENGRIEß, Salz, WEIZENGLUTEN, Gewürze, Hefeextrakt, modifizierte Stärke (enthält WEIZEN), Dextrose. Hähnchenfleisch (46%), WEIZENMEHL, Wasser, pflanzliches Öl (Sonnenblume,Raps), Brot