INSERT [dbo].[product] ([id], [title], [description], [picture], [ingredients]) VALUES (23555, N'McToast® Ham & Cheese', N'Aufstehen lohnt sich wieder, denn den McToast® gibt’s jetzt mit neuer Rezeptur. Zartschmelzender Cheese und saftiger Schinken umhüllt von zwei leckeren Toast-Scheiben lassen deine müden Augen ganz groß werden. Denn mit dem McToast® Ham & Cheese kann der Tag nur gut werden: ganz gleich ob einzeln, im Frühstücks-Duo oder Frühstücks-Menü.', N'https://www.mcdonalds.com/is/image/content/dam/de/nutrition/items/icons/desktop/1301_thumb.jpg?$Category_Desktop$', N'Toastbrot: Zutaten: WEIZENMEHL, Wasser, BUTTERREINFETT (2,8 %), Zucker, Salz, Hefe, Säureregulator: Natriumacetate (E 262), Mehlbehandlungsmittel: Ascorbinsäure (E 300).  Schmelzkäsezubereitung Cheddar: Zutaten: KÄSE (49%), Wasser, Cheddar KÄSE (11%), BUTTER, MAGERMILCHPULVER, Schmelzsalze (E331), natürliches KÄSEaroma, MILCHEIWEISS, Speisesalz, Farbstoffe (Beta-Carotin, Paprikaextrakt), Säureregulator (E330), Trennmittel: Sonnenblumenlecithine. KÄSE (49%), Wasser, Cheddar KÄSE (11%), BUTTER, MAGERMILCHPULVER, Schmelzsalze (E331), natürliches KÄSEaroma, MILCHEIWEISS, Speisesalz, Farbstoffe (Beta-Carotin, Paprikaextrakt), Säureregulator (E330), Trennmittel: Sonnenblumenlecithine.  Schinken : Zutaten: Schweinefleisch, Salz, Glukose, Säuerungsmittel: Natriumcitrate, Säureregulator: Natriumcarbonate, Verdickungsmittel: E407a, Gewürzextrakt, Stabilisator: Natriumascorbat; Gewürze; Konservierungsstoff: Natriumnitrit.')
INSERT [dbo].[product] ([id], [title], [description], [picture], [ingredients]) VALUES (23641, N'Bagel Schinken Käse', N'Du willst, dass dein Morgen ''ne runde Sache wird? Dann solltest du dir den Bagel Schinken Käse holen. Der getoastete Bagel sorgt Schicht für Schicht für das erste Lächeln am Morgen. Saftiger Schinken, Ranch-Sauce, knackiger Salat und leckere Tomatenscheiben runden dein Frühstück perfekt ab. Jetzt einzeln, im Frühstücks-Duo oder Frühstücks-Menü genießen.', N'https://www.mcdonalds.com/is/image/content/dam/de/nutrition/items/icons/desktop/1515_thumb.jpg?$Category_Desktop$', N'Bagel: Zutaten: WEIZENMEHL, Wasser, Zucker, Salz, Palmfett, pflanzliche Öle (Raps, Sonnenblume), Malzmehl (DINKELWEIZEN, WEIZEN), Maisgrieß, SOJAMEHL, DINKELWEIZENMEHL, WEIZENSTÄRKE, Verdickungsmittel: Guarkernmehl; Emulgatoren: Mono- und Diglyceride von Speisefettsäuren, Sonnenblumenlecithine; Hefe.  Ranch Sauce: Zutaten: BUTTERMILCH, Rapsöl, Wasser, Branntweinessig, Zucker, modifizierte Maisstärke, EIGELB, Salz, Gewürze, Petersilie, Verdickungsmittel (E 415), Konservierungsstoff (E 202), Säuerungsmittel (E 270), Gewürzextrakt.    Salat Lollo Bionda: Zutaten: Lollo Bionda, unregelmäßiger Schnitt.  Käse: Käse Cheddar: Zutaten: MILCH, Käsereikulturen, Speisesalz, mikrobielles Lab. Nur in teilnehmenden Testrestaurants: Käse Hofmilchkäse: Zutaten: pasteurisierte MILCH, Speisesalz, Farbstoff Carotin, Käsereikulturen (MILCH), mikrobielles Lab.   Tomatenscheibe: Zutaten: 100% Tomate. , 100% Tomate.  Schinken: Zutaten: Schweinefleisch, Salz, Glukose, Säuerungsmittel: Natriumcitrate, Säureregulator: Natriumcarbonate, Verdickungsmittel: E407a, Gewürzextrakt, Stabilisator: Natriumascorbat; Gewürze; Konservierungsstoff: Natriumnitrit.')
INSERT [dbo].[product] ([id], [title], [description], [picture], [ingredients]) VALUES (23728, N'Bagel Double Beef & Egg', N'Manche Tage verlangen nach einem starken Frühstück wie dem Bagel Double Beef & Egg. Die zwei saftigen Beef-Patties, unser Round Egg, leckerer Schmelzkäse, cremige Hollandaise-Sauce und gegrillte Zwiebeln geben dir die perfekte Stärkung für den Tag. Und den passenden Wachmacher kannst du mit unseren McCafé®-Produkten im Frühstücks-Duo oder Frühstücks-Menü einfach dazubestellen.', N'https://www.mcdonalds.com/is/image/content/dam/de/nutrition/items/icons/desktop/1518_thumb.jpg?$Category_Desktop$', N'Schmelzkäsezubereitung Cheddar: Zutaten: KÄSE (49%), Wasser, Cheddar KÄSE (11%), BUTTER, MAGERMILCHPULVER, Schmelzsalze (E331), natürliches KÄSEaroma, MILCHEIWEISS, Speisesalz, Farbstoffe (Beta-Carotin, Paprikaextrakt), Säureregulator (E330), Trennmittel: Sonnenblumenlecithine. KÄSE (49%), Wasser, Cheddar KÄSE (11%), BUTTER, MAGERMILCHPULVER, Schmelzsalze (E331), natürliches KÄSEaroma, MILCHEIWEISS, Speisesalz, Farbstoffe (Beta-Carotin, Paprikaextrakt), Säureregulator (E330), Trennmittel: Sonnenblumenlecithine.  Bagel: Zutaten: WEIZENMEHL, Wasser, Zucker, Salz, Palmfett, pflanzliche Öle (Raps, Sonnenblume), Malzmehl (DINKELWEIZEN, WEIZEN), Maisgrieß, SOJAMEHL, DINKELWEIZENMEHL, WEIZENSTÄRKE, Verdickungsmittel: Guarkernmehl; Emulgatoren: Mono- und Diglyceride von Speisefettsäuren, Sonnenblumenlecithine; Hefe.  gegrillte weiße Zwiebeln: Zutaten: 100% weiße Zwiebeln Sauce Hollandaise : Zutaten: Rapsöl, Wasser, EIGELB, modifizierte Maisstärke, MAGERMILCHPULVER, Branntweinessig, natürliches Aroma (mit SELLERIE), Salz, Hefeextrakt, Zucker, Säuerungsmittel (E 270), Verdickungsmittel (E 415), Konservierungsstoff (E 202), Farbstoff (E 160a).  Ei Round Egg Muffin: Zutaten: 100% EI. Erzeugnis aus Butter- und Sonnenblumenöl. Zutaten: Sonnenblumenöl (75%), BUTTERÖL (21%), Emulgatoren: (E471), Lecithine (Sonnenblumen), MOLKENERZEUGNIS (MILCH), Antioxidationsmittel: (E304, E307), BUTTERAROMA.  Beef Patty 10:1: Zutaten: 100% Rindfleisch.')
INSERT [dbo].[product] ([id], [title], [description], [picture], [ingredients]) VALUES (23816, N'McWrap® Rührei Ham & Cheese', N'Rührei oder doch lieber Schinken und Schmelzkäse? Warum entscheiden, wenn man auch beides haben kann? Der McWrap® Rührei Ham & Cheese ist der ideale Wegbegleiter für deinen Morgen. Saftiger Schinken, Schmelzkäse und leckeres Rührei vereinen sich in unserem Weizentortilla zu dem besten Frühstück für unterwegs. Jetzt einzeln gönnen oder im Frühstücks-Duo bzw. im Frühstücks-Menü zusammen mit einer Kaffeespezialität genießen.', N'https://www.mcdonalds.com/is/image/content/dam/de/nutrition/items/icons/desktop/1521_thumb.jpg?$Category_Desktop$', N'Schmelzkäsezubereitung Cheddar: Zutaten: KÄSE (49%), Wasser, Cheddar KÄSE (11%), BUTTER, MAGERMILCHPULVER, Schmelzsalze (E331), natürliches KÄSEaroma, MILCHEIWEISS, Speisesalz, Farbstoffe (Beta-Carotin, Paprikaextrakt), Säureregulator (E330), Trennmittel: Sonnenblumenlecithine. KÄSE (49%), Wasser, Cheddar KÄSE (11%), BUTTER, MAGERMILCHPULVER, Schmelzsalze (E331), natürliches KÄSEaroma, MILCHEIWEISS, Speisesalz, Farbstoffe (Beta-Carotin, Paprikaextrakt), Säureregulator (E330), Trennmittel: Sonnenblumenlecithine.  Bun Tortilla Grillstreifen: Zutaten: Angereichertes WEIZENMEHL (WEIZENMEHL, Calcium, Eisen, Niacin, Thiamin), Wasser, pflanzliche Öle (Palmöl, Rapsöl), Zucker, Backtriebmittel (Natriumbicarbonat, Dinatriumdiphosphat, Äpfelsäure), Speisesalz.  Rühreizubereitung: Zutaten: VOLLEI, SAHNE, VOLLMILCH, Stabilisator (E1442, E1422), Salz, Rapsöl, Zucker, Säuerungsmittel: Citronensäure. Erzeugnis aus Butter- und Sonnenblumenöl. Zutaten: Sonnenblumenöl (75%), BUTTERÖL (21%), Emulgatoren: (E471), Lecithine (Sonnenblumen), MOLKENERZEUGNIS (MILCH), Antioxidationsmittel: (E304, E307), BUTTERAROMA.  Salat Lollo Bionda: Zutaten: Lollo Bionda, unregelmäßiger Schnitt.  Tomatenscheibe: Zutaten: 100% Tomate.  Sauce Sandwich: Zutaten: Wasser, Rapsöl, Glukose-Fruktose-Sirup, Branntweinessig, modifizierte Maisstärke, EIGELB, Salz, Zucker, Verdickungsmittel (E 415), Gewürze (mit SENFSAAT), Konservierungsstoff (E 202).  Schinken : Zutaten: Schweinefleisch, Salz, Glukose, Säuerungsmittel: Natriumcitrate, Säureregulator: Natriumcarbonate, Verdickungsmittel: E407a, Gewürzextrakt, Stabilisator: Natriumascorbat; Gewürze; Konservierungsstoff: Natriumnitrit.')
INSERT [dbo].[product] ([id], [title], [description], [picture], [ingredients]) VALUES (23905, N'Rührei Bacon', N'Zu einem perfekten Frühstück gehört das perfekte Rührei. Bei McDonald’s® bedeutet das: leckeres Ei kombiniert mit krossem Bacon und einem soften McMuffin® Bun. Nach diesem Klassiker kannst du ganz entspannt in deinen Tag starten.', N'https://www.mcdonalds.com/is/image/content/dam/de/nutrition/items/icons/desktop/1690_thumb.jpg?$Category_Desktop$', N'Bun Muffin: Zutaten: WEIZENMEHL, Wasser, Maisgrieß, Hefe, Dextrose, Salz, WEIZENGLUTEN, Emulgatoren: (Mono- und Diglyceride von Speisefettsäuren (E471), Diacetylweinsäureester von Mono- und Diglyceriden von Speisefettsäuren (E472e)), Säuerungsmittel: (Citronensäure (E330)), WEIZENVOLLKORNMEHL, ROGGENVOLLKORNMEHL. Erzeugnis aus Butter- und Sonnenblumenöl. Zutaten: Sonnenblumenöl (75%), BUTTERÖL (21%), Emulgatoren: (E471), Lecithine (Sonnenblumen), MOLKENERZEUGNIS (MILCH), Antioxidationsmittel: (E304, E307), BUTTERAROMA.  Bacon Streifen: Zutaten: Schweinebauchspeck (92%), Salz, Konservierungsstoff: (E250), Säureregulator: (E326), Stabilisator: (E450), Antioxidationsmittel: (E301), Raucharomen, Glucosesirup, Aromen.  Rühreizubereitung: Zutaten: VOLLEI, SAHNE, VOLLMILCH, Stabilisator (E1442, E1422), Salz, Rapsöl, Zucker, Säuerungsmittel: Citronensäure. Erzeugnis aus Butter- und Sonnenblumenöl. Zutaten: Sonnenblumenöl (75%), BUTTERÖL (21%), Emulgatoren: (E471), Lecithine (Sonnenblumen), MOLKENERZEUGNIS (MILCH), Antioxidationsmittel: (E304, E307), BUTTERAROMA.')
INSERT [dbo].[product] ([id], [title], [description], [picture], [ingredients]) VALUES (23995, N'Bircher-Müsli', N'Das solltest du wirklich nicht verschlafen: Das Bircher-Müsli ist unsere fruchtige Frühstücks-Neuheit, die dir eine köstliche Portion Energie für den Tag gibt. Leckere Äpfel, rote Johannisbeeren und Cranberries verleihen dem Bircher-Müsli jede Menge Genuss. Und dir die richtige Stärkung für den Tag.', N'https://www.mcdonalds.com/is/image/content/dam/de/nutrition/items/icons/desktop/1524_thumb.jpg?$Category_Desktop$', N'Bircher Müsli: Zutaten: Apfel, JOGHURT (16%), Getreideflocken (HAFER, WEIZEN, ROGGEN, GERSTE) (13%), VOLLMILCH, rote Johannisbeeren, Apfelmark, Cranberries gesüßt, getrocknet (Cranberries, Rohrzucker, Sonnenblumenöl), SCHLAGSAHNE, Honig (2%), Zitronensaft, Speisesalz, Säuerungsmittel: Zitronensäure, Zitronenaroma.')
INSERT [dbo].[product] ([id], [title], [description], [picture], [ingredients]) VALUES (24086, N'Hash Brown', N'Kartoffeln zum Frühstück? Das gibt’s nur bei McDonald’s®. Unser Hash Brown ist der Kartoffelpuffer für Frühaufsteher. Du kannst ihn entweder einzeln oder im Frühstücks-Menü genießen. Worauf wartest du also noch? Augen auf und reinbeißen!', N'https://www.mcdonalds.com/is/image/content/dam/de/nutrition/items/icons/desktop/1527_thumb.jpg?$Category_Desktop$', N'Kartoffel-Rösti: Zutaten: Kartoffeln, Mischung aus nicht hydriertem Pflanzenöl (Sonnenblume, Raps), Salz, Maismehl, dehydrierte Kartoffel, Dextrose, Stabilisator (Diphosphat), Extrakt aus schwarzem Pfeffer.')
INSERT [dbo].[product] ([id], [title], [description], [picture], [ingredients]) VALUES (24178, N'Buttercroissant', N'Für die Schweizer ist dieses französische Gebäckteilchen nicht nur sprichwörtlich der Gipfel. Sie nennen es sogar so. Wir halten uns einfach an die Franzosen und finden unser köstliches Croissant ebenfalls très magnifique.', N'https://www.mcdonalds.com/is/image/content/dam/de/nutrition/items/icons/desktop/1362_thumb.jpg?$Category_Desktop$', N'Buttercroissant: Zutaten: WEIZENMEHL, BUTTER (22%), Wasser, pasteurisiertes VOLLEI, Hefe, Zucker, WEIZENGLUTEN, Salz, VOLLMILCHPULVER, LAKTOSE, Emulgatoren: (Mono- und Diacetylweinsäureester von Mono- und Diglyceriden von Speisefettsäuren, Mono- und Diglyceride von Speisefettsäuren), Stabilisatoren: (Carboxymethylcellulose, Xanthan), Traubenzucker, MAGERMILCHPULVER, WEIZENMALZMEHL, natürliches Aroma, Mehlbehandlungsmittel: (Ascorbinsäure, Enzyme: (Amylasen, Proteasen, Xylanasen, Transglutaminasen), Pflanzenfasern).')
