INSERT [dbo].[product] ([id], [title], [description], [picture], [ingredients]) VALUES (24950, N'Cappuccino Small', N'Wusstest du, dass sich der Name des Cappuccinos vom italienischen Wort für Kapuze ableitet, weil seine Farbe an die Kutten der Kapuzinermönche erinnert? Hier muss sich aber niemand in Abstinenz üben. Ganz im Gegenteil. Bestell bitte munter drauf los! Egal ob im McCafé oder in McCafé Qualität am McDonald’s Counter und im McDrive.  Auch mit laktosefreier¹ Milch oder Haferdrink genießbar. ¹ Laktosegehalt kleiner 0,1g je 100g Milch', N'https://www.mcdonalds.com/is/image/content/dam/de/nutrition/items/icons/desktop/7190_thumb.jpg?$Category_Desktop$', N'Espresso: Zutaten: 100% Arabica Bohnen.  Milch 3,5% Fett: Zutaten: H-VollMILCH 3,5% Fett.')
