INSERT [dbo].[product] ([id], [title], [description], [picture], [ingredients]) VALUES (26116, N'ViO Mineralwasser Medium 0,5l', N'Das ist Erfrischung für jeden Geschmack. Egal ob für Coole, für Spritzige oder für pure Genießer: Bei McDonald’s ist einfach alles drin!', N'https://www.mcdonalds.com/is/image/content/dam/de/nutrition/items/icons/desktop/7360_thumb.jpg?$Category_Desktop$', N'Zutaten: Natürliches Mineralwasser, mit Kohlensäure versetzt.  Hersteller: Coca-Cola European Partners DE, Postfach 670156, 10207 Berlin.  Kühl und trocken lagern.')
