INSERT [dbo].[product] ([id], [title], [description], [picture], [ingredients]) VALUES (28546, N'Red Bull 0,25l', N'Red Bull Energy Drink – Flügel wenn man sie braucht. Weltweit geschätzt im Spitzensport, beim Studieren, in stark fordernden Berufen sowie bei langen Autofahrten.', N'https://www.mcdonalds.com/is/image/content/dam/de/nutrition/items/icons/desktop/7378_thumb.jpg?$Category_Desktop$', N'Zutaten: Wasser, Saccharose, Glucose, Säureregulator (Natriumcitrate, Magnesiumcarbonat), Kohlensäure, Säuerungsmittel Zitronensäure, Taurin (0,4%), Koffein (0,03%), Inosit, Vitamine (Niacin, Pantothensäure, B6, B12), Aroma, Farbstoffe (einfache Zuckerkulör, Riboflavin).  Hersteller: Red Bull GmbH, 5330 Fuschl am See.')
