 Erfrischend exotischer Geschmack ganz ohne Zuckerzusatz.', N'https://www.mcdonalds.com/is/image/content/dam/de/nutrition/items/icons/desktop/7279_thumb.jpg?$Category_Desktop$', N'Zutaten: Wasser, 26 % Traubensaft aus Traubensaftkonzentrat, 17 % Apfelsaft aus Apfelsaftkonzentrat, 3 % Passionsfrucht aus Passionsfruchtsaftkonzentrat, 1 % Acerolasaft aus Acerolasaftkonzentrat, 1 % Ananassaft aus Ananassaftkonzentrat, 1 % Zitronensaft aus Zitronensaftkonzentrat, 1 % Mangomark aus Mangomarkkonzentrat. Capri Sun Vertriebs GmbH Rudolf-Wild-Strasse 86-98, D-69214 Eppelheim/Heidelberg.')
