INSERT [dbo].[product] ([id], [title], [description], [picture], [ingredients]) VALUES (29216, N'Cold Brew Café 0,4l', N'Wenn die Sonne scheint und die Temperaturen steigen, ist es Zeit für ein cooles Comeback: unser Cold Brew Café ist wieder da! Bei der Herstellung wird der Kaffee nicht mit heißem Wasser gebrüht, sondern mit kaltem Wasser über mehrere Stunden extrahiert. Heraus kommt eine besonders erfrischende Kaffeespezialität – perfekt für heiße Sommertage!', N'https://www.mcdonalds.com/is/image/content/dam/de/nutrition/items/icons/desktop/7831_thumb.jpg?$Category_Desktop$', N'Eiswürfel: Zutaten: Trinkwasser. Cold Brew Coffee: Zutaten: Wasser, Kaffee (RFA), Säureregulator Natriumhydrogencarbonat (E500).')
INSERT [dbo].[product] ([id], [title], [description], [picture], [ingredients]) VALUES (29353, N'Cold Brew Latte 0,4l', N'Wetten, du hast noch nie einen cooleren Latte getrunken? Unser Cold Brew Latte ist nämlich Kaltgetränk und Wachmacher in einem! Überzeug dich von seiner Coolness und genieß ihn ganz entspannt in der Sonne oder im Schatten – er schmeckt eigentlich
 überall herrlich erfrischend.
 Auch mit laktosefreier¹ Milch oder Haferdrink erfrischend lecker.
 ¹Laktosegehalt kleiner 0,1g je 100g Milch.', N'https://www.mcdonalds.com/is/image/content/dam/de/nutrition/items/icons/desktop/7832_thumb.jpg?$Category_Desktop$', N'Eiswürfel: Zutaten: Trinkwasser. Cold Brew Coffee: Zutaten: Wasser, Kaffee (RFA), Säureregulator Natriumhydrogencarbonat (E500).  Milch 3,5% Fett: Zutaten: H-VollMILCH 3,5% Fett.')
INSERT [dbo].[product] ([id], [title], [description], [picture], [ingredients]) VALUES (29491, N'Cold Brew Salted Caramel Latte 0,4l', N'Du bist trendbewusst und immer offen für Neues? Dann lern mal unseren Cold Brew Salted Caramel Latte kennen! Erfrischender Cold Brew kombiniert mit verführerisch salzig-süßem Geschmack und leckerer Milch. Krass, du liest immer noch diesen Text? Na los, gönn dir schnell einen!
 Auch mit laktosefreier¹ Milch oder Haferdrink erfrischend lecker.
 ¹Laktosegehalt kleiner 0,1g je 100g Milch.', N'https://www.mcdonalds.com/is/image/content/dam/de/nutrition/items/icons/desktop/7833_thumb.jpg?$Category_Desktop$', N'Eiswürfel: Zutaten: Trinkwasser. Salted Caramel Flavour Syrup: Zutaten: Wasser, Zucker, natürliche Aromen, Meersalz, Konservierungsstoff (Kaliumsorbat), Säureregulator (Citronensäure).  Cold Brew Coffee: Zutaten: Wasser, Kaffee (RFA), Säureregulator Natriumhydrogencarbonat (E500). Milch 3,5% Fett: Zutaten: H-VollMILCH 3,5% Fett.')
INSERT [dbo].[product] ([id], [title], [description], [picture], [ingredients]) VALUES (29630, N'Espresso Small', N'25 Sekunden. So lange braucht die Maschine, um aus fein gemahlenen Arabica-Bohnen köstlichen Espresso mit haselnussbrauner Crema zu machen. Ganz schön schnell für Genuss, den man so schnell nicht wieder vergisst.', N'https://www.mcdonalds.com/is/image/content/dam/de/nutrition/items/icons/desktop/7195_thumb.jpg?$Category_Desktop$', N'Trinkwasser: Zutaten: Trinkwasser  Espresso: Zutaten: 100% Arabica Bohnen.')
INSERT [dbo].[product] ([id], [title], [description], [picture], [ingredients]) VALUES (29770, N'Espresso Grande', N'25 Sekunden. So lange braucht die Maschine, um aus fein gemahlenen Arabica-Bohnen köstlichen Espresso mit haselnussbrauner Crema zu machen. Ganz schön schnell für Genuss, den man so schnell nicht wieder vergisst.', N'https://www.mcdonalds.com/is/image/content/dam/de/nutrition/items/icons/desktop/7196_thumb.jpg?$Category_Desktop$', N'Trinkwasser: Zutaten: Trinkwasser. Espresso: Zutaten: 100% Arabica Bohnen.')
INSERT [dbo].[product] ([id], [title], [description], [picture], [ingredients]) VALUES (29911, N'Milchkaffee Regular', N'Wen es in den Niederlanden nach einem frisch gebrühten Kaffee mit extra Milchschaum dürstet, der bestellt einen „Kaffee verkehrt“. Verkehrt ist an dem köstlichen Milchkaffee aber gar nichts. Außer dass du ihn dir vielleicht noch nicht geholt hast.  Auch mit laktosefreier¹ Milch oder Haferdrink genießbar. ¹ Laktosegehalt kleiner 0,1g je 100g Milch', N'https://www.mcdonalds.com/is/image/content/dam/de/nutrition/items/icons/desktop/7815_thumb.jpg?$Category_Desktop$', N'Trinkwasser: Zutaten: Trinkwasser.  Espresso: Zutaten: 100% Arabica Bohnen.  Milch 3,5% Fett: Zutaten: H-VollMILCH 3,5% Fett.')
INSERT [dbo].[product] ([id], [title], [description], [picture], [ingredients]) VALUES (30053, N'Milchkaffee Grande', N'Wen es in den Niederlanden nach einem frisch gebrühten Kaffee mit extra Milchschaum dürstet, der bestellt einen „Kaffee verkehrt“. Verkehrt ist an dem köstlichen Milchkaffee aber gar nichts. Außer dass du ihn dir vielleicht noch nicht geholt hast.  Auch mit laktosefreier¹ Milch oder Haferdrink genießbar. ¹ Laktosegehalt kleiner 0,1g je 100g Milch', N'https://www.mcdonalds.com/is/image/content/dam/de/nutrition/items/icons/desktop/7816_thumb.jpg?$Category_Desktop$', N'Trinkwasser: Zutaten: Trinkwasser. Espresso: Zutaten: 100% Arabica Bohnen.  Milch 3,5% Fett: Zutaten: H-VollMILCH 3,5% Fett.')
INSERT [dbo].[product] ([id], [title], [description], [picture], [ingredients]) VALUES (30196, N'Café Latte Regular', N'Ein doppelter Espresso. Dazu heiße Milch. Die lässt die gern zum Frühstück getrunkene italienische Variante des Milchkaffees in wunderbar haselnussbrauner Farbe erstrahlen. Das weckt den Appetit. Zum Beispiel auf ein leckeres Frühstück in deinem McCafé.  Auch mit laktosefreier¹ Milch oder Haferdrink genießbar. ¹ Laktosegehalt kleiner 0,1g je 100g Milch', N'https://www.mcdonalds.com/is/image/content/dam/de/nutrition/items/icons/desktop/7811_thumb.jpg?$Category_Desktop$', N'Espresso: Zutaten: 100% Arabica Bohnen. Milch 3,5% Fett: Zutaten: H-VollMILCH 3,5% Fett.')
