INSERT [dbo].[product] ([id], [title], [description], [picture], [ingredients]) VALUES (31376, N'Chai Latte Regular', N'Niederländische Seefahrer brachten das exotische Heißgetränk aus dem Orient einst nach Europa. Herrlich aromatisch schmeckt’s nur mit einer Geschmackskomposition aus Kardamom, Zimt, Ingwer und Nelken. Exotischer wird’s nicht. Außer du behauptest, dieses köstliche Getränk noch nie probiert zu haben.  Auch mit laktosefreier¹ Milch oder Haferdrink genießbar. ¹ Laktosegehalt kleiner 0,1g je 100g Milch', N'https://www.mcdonalds.com/is/image/content/dam/de/nutrition/items/icons/desktop/7819_thumb.jpg?$Category_Desktop$', N'McCafé Sirup Chai: Zutaten: Fruktosesirup, Glukosesirup, Zucker, Feuchthaltemittel (Glycerin),Wasser, Farbstoff (Zuckerkulör), natürliche Aromen. Zimt-Zucker McCafé: Zutaten: Zucker, Zimt.  Milch 3,5% Fett: Zutaten: H-VollMILCH 3,5% Fett.')
INSERT [dbo].[product] ([id], [title], [description], [picture], [ingredients]) VALUES (31528, N'Chai Latte Grande', N'Niederländische Seefahrer brachten das exotische Heißgetränk aus dem Orient einst nach Europa. Herrlich aromatisch schmeckt’s nur mit einer Geschmackskomposition aus Kardamom, Zimt, Ingwer und Nelken. Exotischer wird’s nicht. Außer du behauptest, dieses köstliche Getränk noch nie probiert zu haben.  Auch mit laktosefreier¹ Milch oder Haferdrink genießbar. ¹ Laktosegehalt kleiner 0,1g je 100g Milch', N'https://www.mcdonalds.com/is/image/content/dam/de/nutrition/items/icons/desktop/7820_thumb.jpg?$Category_Desktop$', N'McCafé Sirup Chai: Zutaten: Fruktosesirup, Glukosesirup, Zucker, Feuchthaltemittel (Glycerin),Wasser, Farbstoff (Zuckerkulör), natürliche Aromen.  Zimt-Zucker McCafé: Zutaten: Zucker, Zimt.  Milch 3,5% Fett: Zutaten: H-VollMILCH 3,5% Fett.')
INSERT [dbo].[product] ([id], [title], [description], [picture], [ingredients]) VALUES (31681, N'N.Y. Style Cheesecake', N'Cheeeeeese! Unser köstlicher N.Y. Style Cheesecake zaubert dir mit jedem Bissen ein Lächeln ins Gesicht. Noch breiter wirst du grinsen, wenn du ihn mit fruchtiger Rote-Grütze-Sauce kombinierst. Kein Käse, das geht wirklich – probier’s aus. Simply delicious!', N'https://www.mcdonalds.com/is/image/content/dam/de/nutrition/items/icons/desktop/9050_thumb.jpg?$Category_Desktop$', N'N.Y. Cheesecake Style: Zutaten: FRISCHKÄSE Doppelrahmstufe (39%), Zucker, Wasser, WEIZENMEHL, VOLLEI, Rapsöl, Palmfett, modifizierte Stärke, SAHNE, SÜSSMOLKENPULVER, Gelatine, Kartoffelstärke, WEIZENSTÄRKE, MAGERMILCHPULVER, MILCHZUCKER, Speisesalz, Backtriebmittel (E450, E500), Dextrose, Glukosesirup, Verdickungsmittel (E401), Stabilisator (E516), natürliches Aroma, färbende Lebensmittel (Karotten-Konzentrat, Kürbis-Konzentrat), MILCHEIWEISS, Emulgatoren (E322, E471), Säuerungsmittel (E330), Säureregulator (E300).')
INSERT [dbo].[product] ([id], [title], [description], [picture], [ingredients]) VALUES (31835, N'N.Y. Style Cheesecake mit Rote-Grütze-Sauce', N'Cheeeeeese! Unser köstlicher N.Y. Style Cheesecake zaubert dir mit jedem Bissen ein Lächeln ins Gesicht. Noch breiter wirst du grinsen, wenn du ihn mit fruchtiger Rote-Grütze-Sauce kombinierst. Kein Käse, das geht wirklich – probier’s aus. Simply delicious!', N'https://www.mcdonalds.com/is/image/content/dam/de/nutrition/items/icons/desktop/90504342_thumb.jpg?$Category_Desktop$', N'Rote Grütze Sauce: Zutaten: Fruchtmischung 50% (Sauerkirschen, Himbeeren, Schwarze Johannisbeeren, Heidelbeeren, Rote Johannisbeeren), Zucker, Glukosesirup, modifizierte Stärke, Säuerungsmittel: Citronensäure, Geliermittel: Pektin, natürliches Aroma, Stabilisator: Calciumcitrat.  N.Y. Cheesecake Style: Zutaten: FRISCHKÄSE Doppelrahmstufe (39%), Zucker, Wasser, WEIZENMEHL, VOLLEI, Rapsöl, Palmfett, modifizierte Stärke, SAHNE, SÜSSMOLKENPULVER, Gelatine, Kartoffelstärke, WEIZENSTÄRKE, MAGERMILCHPULVER, MILCHZUCKER, Speisesalz, Backtriebmittel (E450, E500), Dextrose, Glukosesirup, Verdickungsmittel (E401), Stabilisator (E516), natürliches Aroma, färbende Lebensmittel (Karotten-Konzentrat, Kürbis-Konzentrat), MILCHEIWEISS, Emulgatoren (E322, E471), Säuerungsmittel (E330), Säureregulator (E300).')
INSERT [dbo].[product] ([id], [title], [description], [picture], [ingredients]) VALUES (31990, N'Banana Bread', N'Einmal probiert, findest du alles andere total Banane. Warum? Na, wegen der herrlich süßen Geschmackskombi aus Bananenchips und Haselnüssen natürlich! Unser neues Banana Bread ist so soft und lecker, dass du dir wirklich mal eine Scheibe davon abschneiden solltest.', N'https://www.mcdonalds.com/is/image/content/dam/de/nutrition/items/icons/desktop/9053_thumb.jpg?$Category_Desktop$', N'Banana Bread: Zutaten: WEIZENMEHL; Rapsöl; Zucker; Wasser; Bananenfüllung (9,9%) (Wasser; Glukose-Fruktose-Sirup; Banane (2,5%); Modifizierte Stärke; Verdickungsmittel: Agar-Agar; Antioxidationsmittel: Ascorbinsäure; Natürliches Aroma; Säuerungsmittel: Citronensäure; Säureregulator: Natriumcitrate; Stabilisator: Diphosphate); Bananenchips (4,9%) (Banane (2,7%); Pflanzliches Öl: Kokos; Zucker; Natürliches Bananenaroma); VOLLEIPULVER AUS FREILANDHALTUNG; MAGERMILCHPULVER; Honig; BUTTER; Stabilisator: Glycerin; HASELNÜSSE (1,0%); Backtriebmittel: Natriumcarbonate; Glukose-Fruktose-Sirup; Zimt; Natürliche gebrannter Zucker; Natürliches Aroma; Geliermittel: Pektine; Säuerungsmittel: Citronensäure; Säureregulator: Natriumcitrate, Calciumchlorid.')
INSERT [dbo].[product] ([id], [title], [description], [picture], [ingredients]) VALUES (32146, N'Love Donut', N'Unser Love Donut mit zarten Kokos-Streuseln on top ist zum Verlieben süß. Er weiß sowohl mit seinen äußeren als auch seinen inneren Werten zu überzeugen. Denn da steckt nicht nur jede Menge Liebe drin, sondern auch fruchtige Rote-Grütze-Sauce.  Willst du mit ihm gehen? Ja oder ja?', N'https://www.mcdonalds.com/is/image/content/dam/de/nutrition/items/icons/desktop/4515_thumb.jpg?$Category_Desktop$', N'Love Donut: Zutaten: WEIZENMEHL, Fettglasur (17%) [Zucker, pflanzliche Fette (Kokos ganz gehärtet, Kokos), pflanzliche Öle (Sonnenblume ganz gehärtet, Sonnenblume), MAGERMILCHPULVER, LAKTOSE, Emulgatoren (Lecithine, E472c), färbende Lebensmittel (Rettichkonzentrat, Schwarze Johannisbeerenkonzentrat, Apfelkonzentrat, Rote Beetekonzentrat), Maltodextrin, Säuerungsmittel: E330, natürliche Aromen, Antioxidationsmittel (E300, E307)], Wasser, Fruchtfüllung (16%) [Früchte (Sauerkirschen, Himbeeren, Rote Johannisbeeren, Schwarze Johannisbeeren), Zucker, Glukose-Fruktose-Sirup, Wasser, Geliermittel: E440, Konservierungsstoff: E202, Säuerungsmittel: E330], pflanzliche Öle (Sonnenblume, Raps), Kokosraspeln (4%), Dextrose, SOJAMEHL, Maisstärke, Emulgatoren: (E471, E472e, E481), Hefe, Salz, Backtriebmittel (E450, E500), Verdickungsmittel: E412, Farbstoff: E160a.')
INSERT [dbo].[product] ([id], [title], [description], [picture], [ingredients]) VALUES (32303, N'Rainbow Donut', N'Wie wär’s mit einem farbenfrohen Snack? Verwöhn‘ dich mit unserem fluffigen Rainbow Donut. Und du wirst sehen: Seine bunte Zuckerglasur ist nicht nur etwas fürs Auge, sondern macht auch deinen Gaumen glücklich. Bei so viel Fröhlichkeit darf ein Smiley im Beschreibungstext natürlich nicht fehlen :-) jippi!', N'https://www.mcdonalds.com/is/image/content/dam/de/nutrition/items/icons/desktop/4172_thumb.jpg?$Category_Desktop$', N'Rainbow Donut: Zutaten: WEIZENMEHL, Fettglasur [Palmkernfett, Zucker, Farbstoff: E170, Maisquellstärke, pflanzliche Öle (Palm, Sonnenblume), SÜSSMOLKENPULVER, Emulgatoren (Lecithine (SOJA), E492, E472c), Maltodextrin, färbende Lebensmittel (Spirulinakonzentrat, Saflorkonzentrat, Zitronenkonzentrat, Apfelkonzentrat, Rettichkonzentrat, Schwarze Johannisbeerenkonzentrat, Rote Beetekonzentrat), Saccharosesirup, Säuerungsmittel: E330, Antioxidationsmittel (E300, E307)], Wasser, pflanzliche Öle (Sonnenblume, Raps), Dextrose, SOJAMEHL, Maisstärke, Emulgatoren: (E471, E472e, E481), Hefe, Salz, Backtriebmittel (E450, E500), Verdickungsmittel: E412, Farbstoff: E160a.')
INSERT [dbo].[product] ([id], [title], [description], [picture], [ingredients]) VALUES (32461, N'Apfelkuchen vegan', N'Unser veganer Apfelkuchen fällt nicht weit vom Stamm. Denn diese saftige Leckerei sieht nicht nur aus wie ein richtiger Apfelkuchen, sondern schmeckt auch so. Und das, obwohl er ganz ohne tierische Zutaten auskommt. Seine zarten Apfelstückchen und die Mandelsplitter on top machen ihn zu einer herrlich süßen Versuchung – auch für NichtVeganer!', N'https://www.mcdonalds.com/is/image/content/dam/de/nutrition/items/icons/desktop/9047_thumb.jpg?$Category_Desktop$', N'Veganer Apfelkuchen: Zutaten: Äpfel (68%), WEIZENMEHL, Zucker, Palmfett, Glukose-Fruktose-Sirup, modifizierte Stärken, Rapsöl, MANDELN, Verdickungsmittel (E410, E415, E412), Säuerungsmittel (E330), natürliche Aromen, Geliermittel (E440), Backtriebmittel (E450, E500), färbende Lebensmittel (Karotten-Konzentrat, Kürbis-Konzentrat), Emulgator (E471), Gewürz (Zimt), Speisesalz, Säureregulatoren (E332, E327, E300), Apfelsaftkonzentrat.')
INSERT [dbo].[product] ([id], [title], [description], [picture], [ingredients]) VALUES (32620, N'Lemon Cheesecake', N'Draußen wird‘s kalt. Drinnen wird’s lecker. In der einen Hand ein Heißgetränk zum Wärmen und in der anderen ein Stück Lemon Cheesecake für die Seele. Die cremige Käsemasse, der lockere Kuchenboden und die verschiedenen Zitrusfrüchte zaubern dir auch bei dem tristen Wetter immer ein Lächeln ins Gesicht. Probiere es gleich aus!', N'https://www.mcdonalds.com/is/image/content/dam/de/nutrition/items/icons/desktop/9038_thumb.jpg?$Category_Desktop$', N'Lemon Cheesecake: Zutaten: FRISCHKÄSE DOPPELRAHMSTUFE (24%), Wasser, Zucker, VOLLMILCH, VOLLEI, WEIZENMEHL, Zitronensaft (aus Zitronensaftkonzentrat) (4%), pflanzliche Fette (Palmfett, Kokosfett, in veränderlichen Gewichtsanteilen), Rapsöl, modifizierte Stärken, Glukose-Fruktose-Sirup, SÜSSMOLKENPULVER, WEIZENSTÄRKE, Kartoffelstärke,  MAGERMILCHPULVER, MILCHZUCKER, Speisesalz, Säureregulatoren (E331, E332, E327, E300), Stabilisatoren (E407, E516), Dextrose, Backtriebmittel (E450, E500), Emulgatoren (E471, E322), natürliche Aromen, färbendes Lebensmittel (Färberdistel-Extrakt), Verdickungsmittel (E401, E412), Glukosesirup, Säuerungsmittel (E330), Geliermittel (E440), Feuchthaltemittel (E420), MILCHEIWEISS.')
INSERT [dbo].[product] ([id], [title], [description], [picture], [ingredients]) VALUES (32780, N'Cinnamon Roll', N'Jetzt wieder im McCafé erhältlich: die Cinnamon Roll. Ein köstliches Gebäck mit Zimt-Geschmack – vom ersten bis zum letzten Bissen ein einzigartiger Genuss! Einfach lecker!', N'https://www.mcdonalds.com/is/image/content/dam/de/nutrition/items/icons/desktop/4161_thumb.jpg?$Category_Desktop$', N'Cinnamon Roll: Zutaten: WEIZENMEHL, Zucker, Wasser, Veganes Streichfett (Shea Butter, Wasser, Kokosöl, Rapsöl, Salz, Karottensaft, Emulgator (Lecithin), Zitronensaft, natürliches Aroma), Margarine (Rapsöl, Wasser, Emulgator (E471), Salz, Säureregulator E330)), Cremepulver (Zucker, modifizierte Kartoffelstärke, MOLKENPULVER, MAGERMILCHPULVER, Kokosöl, Stabilisatoren (E401), Glukosesirup, Farbstoff (E160a), MILCHEIWEIß, Säureregulator (E263), natürliches Vanillearoma, natürliches Aroma), Glasur (Zucker, Kokosöl (vollständig ausgehärtet ), Emulgator (E322), Zimt 1,3%, modifizierte Kartoffelstärke, Trockenhefe, Salz, Emulgatoren (E472e, E471), Stabilisator (E412), Dextrose, Mehlbehandlungsmittel (E300).')
INSERT [dbo].[product] ([id], [title], [description], [picture], [ingredients]) VALUES (32941, N'Erdbeerkuchen mit Buttermilchcreme', N'Wenn sich fruchtig süße Erdbeeren auf einer zarten Buttermilchcreme und einem lockeren Rührteigboden betten, zugedeckt mit einem süßen Tortenguss, dann ist das nichts weniger als ein wahrer Erdbeertraum. Also nimm dir eine Auszeit und lass dich verführen!', N'https://www.mcdonalds.com/is/image/content/dam/de/nutrition/items/icons/desktop/9032_thumb.jpg?$Category_Desktop$', N'Zutaten: Erdbeeren (24%), Wasser, SCHLAGSAHNE (12%), Zucker, BUTTERMILCH(9%), Glukose-Fruktose-Sirup, WEIZENMEHL, VOLLEI, Rapsöl, Dextrose, WEIZENSTÄRKE, Gelatine, modifizierte Stärke, Säuerungsmittel (E330), Verdickungsmittel (E412, E415, E410), Backtriebmittel (E450, E500), MAGERMILCHPULVER, färbende Lebensmittel (Konzentrat aus rotem Rettich, rotes Trauben-Konzentrat, Kirsch-Konzentrat, Färberdistel-Extrakt, Färberdistel-Konzentrat), Glukosesirup, Speisesalz, Geliermittel (E440), natürliche Aromen, Emulgatoren (E471, E472a), Säureregulatoren (E332, E327), Stabilisator (E340).')
INSERT [dbo].[product] ([id], [title], [description], [picture], [ingredients]) VALUES (33103, N'Blaubeer Muffin', N'Luftig-lockerer Rührteig in seiner schönsten Form: Um diese Patisserie-Klassiker für dich perfekt zu machen, haben wir sie nicht nur mit viel Liebe, sondern auch mit jeder Menge saftigen Blaubeeren gebacken.', N'https://www.mcdonalds.com/is/image/content/dam/de/nutrition/items/icons/desktop/4140_thumb.jpg?$Category_Desktop$', N'Zutaten: WEIZENMEHL (WEIZENMEHL, Calciumcarbonat, Niacin, Eisen, Thiamin), Zucker, Rapsöl, VOLLEI aus Freilandhaltung, Blaubeeren (11%), Feuchthaltemittel: Glycerin, modifizierte Stärke, Emulgator: Polyglycerinester von Speisefettsäuren, Natriumstearoyl-2-lactylat, Mono- und Diglyceride von Speisefettsäuren, Backtriebmittel: Diphosphate, Natriumcarbonate, Calciumphosphate, Palmfett, Getrocknetes HÜHNEREIKLAR aus Freilandhaltung, Aroma.  WEIZENMEHL (WEIZENMEHL; WEIZENKLEBER; Calciumcarbonat; Eisen; Niacin; Thiamin); Zucker; Pflanzliche Öle (Sonnenblume, Raps (in veränderlichen Gewichtsanteilen)); Blaubeeren (13%); VOLLEIPULVER aus Freilandhaltung; Wasser; Feuchthaltemittel: Glycerin; Modifizierte Stärke; Emulgator (Polyglycerinester von Speisefettsäuren, Natriumstearoyl-2-lactylat, Mono- und Diglyceride von Speisefettsäuren); Backtriebmittel (Natriumcarbonate, Diphosphate, Calciumphosphate); Palmfett; HÜHNEREIKLARPULVER aus Freilandhaltung; Natürliches Aroma.')
INSERT [dbo].[product] ([id], [title], [description], [picture], [ingredients]) VALUES (33266, N'Schokoladenkuchen', N'Sein Name beschreibt schlicht, was er ist. Wer ihn isst, stellt jedoch schnell fest, dass dieser köstliche Schokoladenkuchen einfach unbeschreiblich lecker schmeckt. Allen, denen bei so viel Genuss die Worte fehlen, sei die Binsenweisheit ein süßer Trost: Kenner genießen und schweigen bekanntlich.', N'https://www.mcdonalds.com/is/image/content/dam/de/nutrition/items/icons/desktop/9026_thumb.jpg?$Category_Desktop$', N'Zutaten: 52% kakaohaltige Fettglasur (Zucker, pflanzliche Fette (Palmöl, Palmkernfett), Sonnenblumenöl, 6 % fettarmes Kakaopulver, VOLLMILCHPULVER, Emulgator: Lecithine (Sonnenblume); natürliches Vanillearoma), Zucker, Rapsöl, VOLLEI, WEIZENMEHL, WEIZENSTÄRKE, Wasser, 1,5% fettarmes Kakaopulver, TROCKENVOLLEIPULVER, modifizierte Stärke, Backtriebmittel: Natriumcarbonate, Diphosphate, Calciumphoshate; Zitronenfaser, SÜSSMOLKENPULVER, EIKLARPULVER, natürliches Aroma, Salz.')
INSERT [dbo].[product] ([id], [title], [description], [picture], [ingredients]) VALUES (33430, N'Schoko Muffin', N'Was macht eigentlich ein Glücksforscher den ganzen Tag? Kleeblätter sammeln und Schweinen hinterherjagen? Wir haben da eine bessere Idee: Der soll doch mal diesen lockerleichten Schoko Muffin mit köstlicher Kakaocremefüllung probieren, der ja bekanntlich Glücksgefühle auslösen soll. Und sich den Rest des Tages freinehmen.', N'https://www.mcdonalds.com/is/image/content/dam/de/nutrition/items/icons/desktop/4143_thumb.jpg?$Category_Desktop$', N'Zutaten: Rapsöl, WEIZENMEHL, Wasser, Zucker, Schokoladencremefüllung (6,2 %) (Fettarmes Kakaopulver (20,5 %), Zucker, Pflanzliche Fette: Palm, Kokos, (in veränderlichen Gewichtsanteilen), Pflanzliche Öle: Raps, Sonnenblumen, VOLLMILCHPULVER, Verdickungsmittel: Natriumalginat, Emulgator: Sonnenblumenlecithine, Natürliches Aroma),kakaohaltige Fettglasur (5,6 %) (Zucker, Palmfett, Fettarmes Kakaopulver, Emulgator: SOJALECITHINE), VOLLEIPULVER, Schokoladendekor aus Zartbitter- und weißer Schokolade (3,1 %) (Zucker, Kakaomasse, Kakaobutter, VOLLMILCHPULVER, BUTTERREINFETT, Fettarmes Kakaopulver, Emulgator: Sonnenblumenlecithine), WEIZENSTÄRKE, Fettarmes Kakaopulver (2,6 %), SÜßMOLKENPULVER, Modifizierte Maisstärke, Reisquellmehl, Backtriebmittel: Diphosphate, Natriumcarbonate, Emulgator: Natriumstearoyl-2-lactylat, Speisesalz.')
INSERT [dbo].[product] ([id], [title], [description], [picture], [ingredients]) VALUES (33595, N'Pecan Nut Cookie', N'Jetzt geht''s rund! Mit dem goldbraunen Pecan Nut Cookie mit verführerischen Pekannuss-Stückchen und Karamell. Einfach zum Wegknuspern!', N'https://www.mcdonalds.com/is/image/content/dam/de/nutrition/items/icons/desktop/4122_thumb.jpg?$Category_Desktop$', N'Zutaten: WEIZENMEHL, Zucker, 16% Karamellzubereitung (Zucker, pflanzliches Fett: (Palmfett, Sheabutter), gezuckerte KONDENSMAGERMILCH, Glukosesirup, Wasser, Cellulosepulver, Maisstärke, Speisesalz, natürliches Aroma, Emulgator: (Sonnenblumenlecithine)), Margarine (Palmöl, Wasser, Rapsöl, Speisesalz, Emulgator: (Sonnenblumenlecithine), Zitronensaftkonzentrat), 6% PEKANNÜSSE, pasteurisiertes VOLLEI*, BUTTER, Invertzuckersirup, Wasser, Backtriebmittel: (Natriumhydrogencarbonat), SÜSSMOLKENPULVER, natürliches Aroma, Speisesalz.  *Eier aus Freilandhaltung.')
INSERT [dbo].[product] ([id], [title], [description], [picture], [ingredients]) VALUES (33761, N'Schoko Donut', N'Bevor du uns ein Loch in den Bauch fragst: Das Loch im Donut erfand 1847 ein Seefahrer, um die süßen Ringe so besser transportieren zu können. Wenn du dich auch für das Drumherum interessierst, dann erzählen wir gerne stundenlang vom lockeren Hefeteig überzogen mit feinster Milchschokolade. Oder du probierst ihn einfach selbst.', N'https://www.mcdonalds.com/is/image/content/dam/de/nutrition/items/icons/desktop/4130_thumb.jpg?$Category_Desktop$', N'WEIZENMEHL, pflanzliche Fette: (Palm), Zucker, Wasser, Kakaomasse, Kakaobutter, MAGERMILCHPULVER, Dextrose, MILCHFETT, Hefe, pflanzliche Öle: (Raps), SOJAMEHL, Speisesalz, Emulgator: (Mono- und Diglyceride von Speisefettsäuren, SOJALECITHINE, Natriumstearoyl-2-lactylat, Polyglycerin-Polyricinleat, Mono- und Diacetylweinsäureester von Mono- und Diglyceriden von Speisefettsäuren), Backtriebmittel: (Diphospate, Natriumcarbonate), MOLKENERZEUGNIS (MILCH).')
INSERT [dbo].[product] ([id], [title], [description], [picture], [ingredients]) VALUES (33928, N'Choc Cookie', N'Es wird behauptet, die Perser hätten den Cookie erfunden. Als Urväter der Schokolade hingegen gelten die Mayas. Man könnte also sagen, dass dieses Stück feinsten Mürbeteigs mit knackigen Schokostückchen nicht nur sehr lecker schmeckt, sondern auch zur Völkerverständigung beiträgt. Nicht schlecht für einen Keks!', N'https://www.mcdonalds.com/is/image/content/dam/de/nutrition/items/icons/desktop/4120_thumb.jpg?$Category_Desktop$', N'Zutaten: 30% MILCHSCHOKOLADENSTÜCKE (Zucker, Kakaobutter, VOLLMILCHPULVER, Kakaomasse, Emulgator: (SOJALECITHINE), natürliches Aroma), WEIZENMEHL, Zucker, Margarine (Palmöl, Wasser, Rapsöl, Speisesalz, Emulgator: (Sonnenblumenlecithine), Zitronensaftkonzentrat), pasteurisiertes VOLLEI*, BUTTER, Invertzuckersirup, Wasser, Backtriebmittel: (Natriumhydrogencarbonat), SÜSSMOLKENPULVER, natürliches Aroma, Speisesalz.  *Eier aus Freilandhaltung.')
INSERT [dbo].[product] ([id], [title], [description], [picture], [ingredients]) VALUES (34096, N'Triple Choc Cookie', N'Guck mal, ein Cookie! Seinen lustigen Namen verdankt dieser süße Schatz den Holländern, seinen leckeren Geschmack aber dem schokoladig-feinen Mürbeteig mit knackigen Schokostückchen.', N'https://www.mcdonalds.com/is/image/content/dam/de/nutrition/items/icons/desktop/4121_thumb.jpg?$Category_Desktop$', N'Zutaten: WEIZENMEHL, Zucker, 14% Schokolade (Zucker, Kakaomasse, Kakaobutter, Emulgator: (SOJALECITHINE), natürliches Aroma), 14% weiße Schokolade (Zucker, VOLLMILCHPULVER, Kakaobutter, Emulgator: (SOJALECITHINE), natürliches Aroma), Margarine (Palmfett, Wasser, Rapsöl, Salz, Emulgator: (Sonnenblumenlecithine), Zitronensaftkonzentrat), pasteurisiertes VOLLEI*, 3% fettarmes Kakaopulver, BUTTER, Invertzuckersirup, Rohrzuckerablaufsirup, Zuckerrübensirup, Wasser, Backtriebmittel: (Natriumhydrogencarbonat), natürliches Aroma, Speisesalz.  *Eier aus Freilandhaltung.')
INSERT [dbo].[product] ([id], [title], [description], [picture], [ingredients]) VALUES (34265, N'Wahlzutat Granola Choc', N'Du bist der Eismacher – du entscheidest über deinen Mix. Bei McFlurry® und der Premium Waffel stehen 4 Toppings und 4 Saucen zur Auswahl. Mach deine eigene Kreation zu deinem ganz persönlichen Geschmackserlebnis und wähl einfach deine Lieblingszutaten aus. Zum Beispiel Topping Granola Choc. Solange der Vorrat reicht.', N'https://www.mcdonalds.com/is/image/content/dam/de/nutrition/items/icons/desktop/4344_thumb.jpg?$Category_Desktop$', N'Triple Chocolate Granola: Zutaten: Mischung von Getreideerzeugnissen: HAFERFLOCKEN, Zucker, WEIZENFLOCKEN, GERSTENFLOCKEN, natürliches Aroma, Antioxidationsmittel (Stark tocopherolhaltige Extrakte), karamellisierter Zucker; 21% Schokolade (Vollmilchschokolade: Zucker, Kakaomasse, VOLLMILCHPULVER, Kakaobutter, Emulgator (Lecithine*); Zartbitterschokolade: Zucker, Kakaomasse, fettarmes Kakaopulver, Emulgator (Lecithine*); Weiße Schokolade: Zucker, Kakaobutter, VOLLMILCHPULVER, Emulgator (Lecithine*). *aus Sonnenblumen')
INSERT [dbo].[product] ([id], [title], [description], [picture], [ingredients]) VALUES (34435, N'Wahlzutat LION®', N'Du bist der Eismacher – du entscheidest über deinen Mix. Bei McFlurry® und der Premium Waffel stehen 4 Toppings und 4 Saucen zur Auswahl. Mach deine eigene Kreation zu deinem ganz persönlichen Geschmackserlebnis und wähl einfach deine Lieblingszutaten aus. Zum Beispiel Topping LION®. Solange der Vorrat reicht.', N'https://www.mcdonalds.com/is/image/content/dam/de/nutrition/items/icons/desktop/4355_thumb.jpg?$Category_Desktop$', N'Lion: Zutaten: Weichkaramellen (Glukosesirup, Zucker, gezuckerte KONDENSMAGERMILCH (MAGERMILCH, Zucker, MILCHZUCKER),pflanzliche Fette (Palm, Shea), Feuchthaltemittel Glycerin, BUTTER, Fondant (Zucker, getrocknet Glukosesirup), Maisstärke, MOLKENERZEUGNIS, Emulgator Mono- und Diglyceride von Speisefettsäuren, natürliches Aroma (mit Farbstoff Zuckerkulör), Knusperstückchen (Reismehl, WEIZENMEHL, brauner Zucker, WEIZENMALZ, WEIZENEIWEIß, Salz), Zucker, Knusperstückchen (WEIZENMEHL, Zucker, Maismehl, fettarmer Kakao, Reismehl, Salz, natürliches Vanillearoma), Cornflakes (Mais, Zucker, Salz, GERSTENMALZEXTRAKT), Kakaobutter, Kakaomasse, MAGERMILCHPULVER, MANDELN, MOLKENERZEUGNIS, pflanzliche Fett (Palm, Shea), BUTTERREINFETT, Emulgator Lecithine, natürliches Vanillearoma.')
INSERT [dbo].[product] ([id], [title], [description], [picture], [ingredients]) VALUES (34606, N'McFlurry® Wahlzutat OREO®', N'Du bist der Eismacher – du entscheidest über deinen Mix. Bei My McFlurry® stehen 4 Toppings und 3 Saucen zur freien Auswahl. Mach deine eigene Kreation zu deinem ganz persönlichen Geschmackserlebnis und wähl einfach deine 2 oder 3 Lieblingszutaten aus – 2 sind im Preis inklusive. Zum Beispiel das Topping OREO®.  Solange der Vorrat reicht!', N'https://www.mcdonalds.com/is/image/content/dam/de/nutrition/items/icons/desktop/4307_thumb.jpg?$Category_Desktop$', N'Topping Oreo: Zutaten: WEIZENMEHL, Zucker, Palmöl, Rapsöl, fettarmes Kakaopulver, WEIZENSTÄRKE, Glukose-Fruktose-Sirup, Backtriebmittel (Kaliumcarbonate, Ammoniumocarbonate, Natriumcarbonate), Speisesalz, Emulgatoren (SOJALECITHIN, Sonnenblumenlecithin), Aroma.')
INSERT [dbo].[product] ([id], [title], [description], [picture], [ingredients]) VALUES (34778, N'McFlurry® Wahlzutat Schokolinsen', N'Du bist der Eismacher - du entscheidest über deinen Mix. Bei My McFlurry® stehen dir 4 köstliche Toppings und 4 leckere Saucen zur Auswahl. Mach deine eigene Kreation zu deinem ganz persönlichen Geschmackserlebnis und wähle einfach deine 2 oder 3 Lieblings-Zutaten aus - 2 davon sind im Preis inclusive. Zum Beispiel Schokolinsen.', N'https://www.mcdonalds.com/is/image/content/dam/de/nutrition/items/icons/desktop/4305_thumb.jpg?$Category_Desktop$', N'Schokolinsen: Zutaten: Zucker, Kakaobutter, VOLLMILCHPULVER, fettarmes Kakaopulver, Stärke, Magermilchpulver, MOLKENPULVER, Emulgator: (Sonnenblumenlecithine), Überzugsmittel: (Gummi arabicum, Carnaubawachs, Bienenwachs), Glukosesirup, färbende Frucht- und Pflanzenkonzentrate: (Traube, Rettich, schwarze Johannisbeere, Zitrone, rote Beete, Carthamus, GERSTENMALZ, Algenkonzentrat (Spirulina).')
INSERT [dbo].[product] ([id], [title], [description], [picture], [ingredients]) VALUES (34951, N'Wahlzutat Rote Grütze-Sauce', N'Du bist der Eismacher – du entscheidest über deinen Mix. Bei McFlurry® und der Premium Waffel stehen 4 Toppings und 4 Saucen zur Auswahl. Mach deine eigene Kreation zu deinem ganz persönlichen Geschmackserlebnis und wähl einfach deine Lieblingszutaten aus. Zum Beispiel Topping Rote-Grütze-Sauce.', N'https://www.mcdonalds.com/is/image/content/dam/de/nutrition/items/icons/desktop/4342_thumb.jpg?$Category_Desktop$', N'Rote Grütze Sauce: Zutaten: Fruchtmischung 50% (Sauerkirschen, Himbeeren, Schwarze Johannisbeeren, Heidelbeeren, Rote Johannisbeeren), Zucker, Glukosesirup, modifizierte Stärke, Säuerungsmittel: Citronensäure, Geliermittel: Pektin, natürliches Aroma, Stabilisator: Calciumcitrat.')
INSERT [dbo].[product] ([id], [title], [description], [picture], [ingredients]) VALUES (35125, N'Wahlzutat Himbeer-Sauce', N'Du bist der Eismacher – du entscheidest über deinen Mix. Bei McFlurry® und der Premium Waffel stehen 4 Toppings und 4 Saucen zur Auswahl. Mach deine eigene Kreation zu deinem ganz persönlichen Geschmackserlebnis und wähl einfach deine Lieblingszutaten aus. Zum Beispiel Topping Himbeer-Sauce.', N'https://www.mcdonalds.com/is/image/content/dam/de/nutrition/items/icons/desktop/4379_thumb.jpg?$Category_Desktop$', N'Himbeersauce: Zutaten: Himbeeren 45%, Zucker, Glukosesirup, Wasser, Verdickungsmittel: Pektin, Säuerungsmittel: Citronensäure.')
