INSERT [dbo].[product] ([id], [title], [description], [picture], [ingredients]) VALUES (35476, N'Wahlzutat Schoko-Sauce', N'Du bist der Eismacher - du entscheidest über deinen Mix. Bei My McFlurry® stehen dir 4 köstliche Toppings und 4 leckere Saucen zur Auswahl. Mach deine eigene Kreation zu deinem ganz persönlichen Geschmackserlebnis und wähle einfach deine 2 oder 3 Lieblings-Zutaten aus - 2 davon sind im Preis inclusive. Zum Beispiel Schoko-Sauce', N'https://www.mcdonalds.com/is/image/content/dam/de/nutrition/items/icons/desktop/4313_thumb.jpg?$Category_Desktop$', N'Topping Schoko: Zutaten: Gezuckerte KONDENSMILCH: (VOLLMILCH, Zucker), Zucker, Wasser, Kokosfett, fettarmes Kakaopulver 5%, modifizierte Stärke, Salz, Stabilisator: (Natriumcitrat).')
INSERT [dbo].[product] ([id], [title], [description], [picture], [ingredients]) VALUES (35653, N'Snack Salad Classic', N'Der Frischekick unter den Snack Salaten. Mit fruchtigen Tomaten und einer leckeren Salatmischung ist er immer der richtige Begleiter.', N'https://www.mcdonalds.com/is/image/content/dam/de/nutrition/items/icons/desktop/3800_thumb.jpg?$Category_Desktop$', N'Salat Mischsalat: Zutaten: Eisberg, Endiviensalat, Lollo Rossa, Frisee, Radicchio.  Tomatenscheibe: Zutaten: 100% Tomate. , 100% Tomate.')
INSERT [dbo].[product] ([id], [title], [description], [picture], [ingredients]) VALUES (35831, N'Ketchup 20ml', N'', N'https://www.mcdonalds.com/is/image/content/dam/de/nutrition/items/icons/desktop/2210_thumb.jpg?$Category_Desktop$', N'Zutaten: 66% Tomatenmark*, Glukose-Fruktose-Sirup, Branntweinessig, Salz, Gewürzextrakte. *Entspricht 184g Tomaten/ 100g Ketchup. Hersteller: Develey Senf&Feinkost GmbH, 82001 Unterhaching, Deutschland. Kühl und trocken lagern.')
