INSERT [dbo].[product] ([id], [title], [description], [picture], [ingredients]) VALUES (36190, N'Buttermilk Ranch Dip 25 ml', N'It’s the thing for the chicken wing: McDonald’s neuer Ranch Dip kombiniert würzige und sahnige Geschmäcker gleichermaßen.  Seine leicht rauchige Note schafft einen himmlischen Kontrast zur köstlich cremigen Buttermilch. Der hell-orange Buttermilk Ranch Dip ist für Vieles eine Bereicherung. Wir lieben ihn besonders mit den Homestyle Mighty Chicken Wings.', N'https://www.mcdonalds.com/is/image/content/dam/de/nutrition/items/icons/desktop/2165_thumb.jpg?$Category_Desktop$', N'Zutaten: Rapsöl, 24% BUTTERMILCH, Zwiebeln, Zucker, Branntweinessig, Wasser, SAHNE, Tomatenmark, Salz, MILCHEIWEIß, modifizierte Maisstärke, Zitronensaft aus Konzentrat, Gewürze, Raucharoma, Kräuter, Gewürzextrakt, Verdickungsmittel (E 415), Konservierungsstoff (E 202).  Develey Senf&Feinkost GmbH, 82001 Unterhaching, Deutschland.')
