CREATE   PROCEDURE [dbo].[pr_user_role]
AS
    IF NOT SYSTEM_USER = 'admin'
        SELECT CONVERT(nvarchar(55), [role]) FROM [user] WHERE [email] = SYSTEM_USER;
    ELSE SELECT 'ADMIN';
GO
/****** Object:  StoredProcedure [dbo].[sp_create_user]    Script Date: 6/24/2021 12:37:37 AM ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE   PROCEDURE [dbo].[sp_create_user] @email nvarchar(55), @pass nvarchar(55), @role nvarchar(5)
AS BEGIN
    IF NOT EXISTS(SELECT * FROM [user] WHERE [email] = @email) BEGIN
        INSERT INTO [user] ([email], [pass], [role]) VALUES (@email, @pass, @role);

        DECLARE @sql nvarchar(255);
        SET @sql = 'CREATE USER ' + @email + ' WITH PASSWORD = ''' + @pass + ''';';
        EXEC(@sql);

        IF (@role = 'BUYER') EXEC sp_grant_buyer_user @username = @email;
        ELSE EXEC sp_grant_staff_user @username = @email;

        RETURN 1;
    END ELSE RAISERROR (15600,-1,-1, 'create user error');
END

GO
