/****** Object:  StoredProcedure [dbo].[sp_grant_buyer_user]    Script Date: 6/24/2021 12:37:37 AM ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE   PROCEDURE [dbo].[sp_grant_buyer_user] @username nvarchar(55)
AS BEGIN
    DECLARE @sql nvarchar(255);
    SET @sql = 'GRANT EXECUTE ON dbo.pr_user_role TO ' + @username + ';';
    EXEC(@sql);
    SET @sql = 'GRANT EXECUTE ON dbo.sp_make_order TO ' + @username + ';';
    EXEC(@sql);
    SET @sql = 'GRANT SELECT ON dbo.category TO ' + @username + ';';
    EXEC(@sql);
    SET @sql = 'GRANT SELECT ON dbo.product TO ' + @username + ';';
    EXEC(@sql);
    SET @sql = 'GRANT SELECT ON dbo.composition TO ' + @username + ';';
    EXEC(@sql);
    SET @sql = 'GRANT SELECT ON dbo.nutrient TO ' + @username + ';';
    EXEC(@sql);
    SET @sql = 'GRANT SELECT ON dbo.unit TO ' + @username + ';';
    EXEC(@sql);
    SET @sql = 'GRANT SELECT ON dbo.price TO ' + @username + ';';
    EXEC(@sql);
    SET @sql = 'GRANT SELECT ON dbo.ref_product_category TO ' + @username + ';';
    EXEC(@sql);
    SET @sql = 'GRANT INSERT ON dbo.item TO ' + @username + ';';
    EXEC(@sql);
END
GO
