CREATE   PROCEDURE [dbo].[sp_grant_staff_user] @username nvarchar(55)
AS BEGIN
    DECLARE @sql nvarchar(255);
    SET @sql = 'GRANT EXECUTE ON dbo.pr_user_role TO ' + @username + ';';
    EXEC(@sql);
    SET @sql = 'GRANT SELECT ON dbo.status TO ' + @username + ';';
    EXEC(@sql);
    SET @sql = 'GRANT SELECT,UPDATE ON dbo.[order] TO ' + @username + ';';
    EXEC(@sql);
    SET @sql = 'GRANT SELECT ON dbo.[user] TO ' + @username + ';';
    EXEC(@sql);
    SET @sql = 'GRANT SELECT ON dbo.[item] TO ' + @username + ';';
    EXEC(@sql);
END
